var index_q0_res_freq = 0;
const readout_osc = 0;  // preliminary! will be updated by controller
configFreqSweep(readout_osc,-500000000.0,1000000.0);
waitZSyncTrigger();
playZero(160);
resetOscPhase();
repeat (16) {
  index_q0_res_freq = 0;
  playZero(176);
  setSweepStep(readout_osc,index_q0_res_freq++);
  playZero(6096);
  startQA(0,0,0,0,1);
  setTrigger(0);
  repeat (1000) {
    playZero(176);
    setSweepStep(readout_osc,index_q0_res_freq++);
    playZero(6096);
    startQA(0,0,0,0,1);
    setTrigger(0);
  }
}
